// src/index.tsx

import { createRoot } from 'react-dom/client';
import App from './App';

// Verifica que el ID aquí sea 'root' y que no tenga errores de escritura.
const rootElement = document.getElementById('root');

// Asegúrate de que rootElement no sea nulo antes de usarlo.
if (rootElement) {
  const root = createRoot(rootElement);
  root.render(
    <React.StrictMode>
      <App />
    </React.StrictMode>
  );
} else {
  console.error('Failed to find the root element. Check your public/index.html');
}
